import { Card } from "react-bootstrap";

interface IProps { 
    title: string;
    text: string;
    function?: () => void; 
}

export default function ICard ({title, text}: IProps) {
    return (
        <Card style={{ width: '18rem', textAlign: 'center', marginBottom: '10px' }}>
        <Card.Body>
          <Card.Title>{title}</Card.Title>
          <Card.Text>
            {text}
          </Card.Text>
        </Card.Body>
      </Card>
    )
}
